def minPath(grid, k):
    n = len(grid)
    dp = [[float('inf')] * (k + 1) for _ in range(n)]
    dp[0][0] = 0
    for i in range(1, n):
        for j in range(1, k + 1):
            for x in range(1, n + 1):
                if grid[i - 1][x - 1] <= grid[i][x - 1]:
                    dp[i][j] = min(dp[i][j], dp[i - 1][j - 1] + grid[i][x - 1])
                if grid[i - 1][x - 1] >= grid[i][x - 1]:
                    dp[i][j] = min(dp[i][j], dp[i - 1][j - 1] + grid[i][x - 1])
    return [grid[i][j] for i in range(n) for j in range(k)]

